      <text id="9" justification="0" size="4" underlined="false">
        <text>Si scriva una classe Lavoratore le cui istanze rappresentano lavoratori. Ogni lavoratore Ã¨ caratterizzato da un nome, un livello (intero da 1 a 5) ed uno stipendio (mensile).
La classe deve contenere un costruttore che assegna al lavoratore un nome ed un livello specificati, i metodi get e set per livello e stipendio, il get per il nome.
Scrivere quindi una classe LavoratoreConStraordinariPagati che estende la classe Lavoratore. La classe deve contenere una nuova variabile di istanza, oreStraordinario,
un costruttore che assegna al lavoratore con straordinari pagati un nome, un livello e un numero di ore di straordinario specificati, i metodi get/setOreStraordinari().
La classe deve inoltre contenere una variabile statica reale retribuzioneOraria, inizializzata a 10.0, corrispondente alla retribuzione di un&apos;ora di straordinario (che si suppone uguale per tutti).
Questo attributo di classe deve essere modificabile con il metodo set appropriato. La classe deve inoltre ridefinire il metodo getStipendio() per tenere conto della retribuzione delle ore di
straordinario: alla retribuzione base (ereditata da Lavoratore) va sommata la retribuzione degli straordinari, ottenuta come retribuzione oraria dello straordinario per numero di ore di
straordinario effettuate. Scrivere infine un programma di prova per collaudare le classi e i metodi.</text>
      </text>
